INSERT INTO `news` VALUES (1,'实验室在国际顶级会议发表重要论文','我实验室张明教授团队在人工智能领域取得重大突破，相关研究成果发表在国际顶级会议上。','近日，我实验室张明教授团队在人工智能领域取得重大突破，提出了一种新的深度学习算法，大幅提升了图像识别的准确率。该研究成果已被国际顶级会议ICCV 2025接收，这是我实验室在计算机视觉领域的又一重要进展。\n\n该算法通过创新的网络架构设计，在保持计算效率的同时显著提升了模型性能。实验结果表明，在标准数据集上，新算法比现有最佳方法准确率提升了5.2%。\n\n这一成果的取得离不开团队成员的共同努力，特别是博士生刘洋和硕士生陈月在算法实现和实验验证方面做出了重要贡献。','张明教授','/uploads/news/news-1760943450855-390729511.jpeg','achievement','published',1,77,'2025-09-28 12:36:19','2025-09-28 12:36:19','2025-10-20 13:06:54'),(2,'实验室成功举办第五届人工智能研讨会','来自全国各地的50余位专家学者齐聚我校，共同探讨人工智能技术的前沿发展。','2025年9月25日，由我实验室主办的第五届人工智能研讨会在学校学术报告厅成功举办。本次研讨会以\"智能技术与未来社会\"为主题，吸引了来自清华大学、北京大学、中科院等知名院校和科研机构的50余位专家学者参会。\n\n会议期间，与会专家围绕机器学习、计算机视觉、自然语言处理等热点领域进行了深入交流。我实验室张明教授作了题为\"深度学习在视觉识别中的新进展\"的主题报告，获得了与会者的高度评价。\n\n此次研讨会不仅促进了学术交流，也为我实验室与其他科研团队建立合作关系提供了良好平台。','李华副教授',NULL,'activity','published',0,16,'2025-09-28 12:36:19','2025-09-28 12:36:19','2025-10-20 13:03:06'),(3,'实验室获得国家自然科学基金重点项目资助','我实验室申报的\"面向复杂场景的智能视觉理解关键技术研究\"项目获得国家自然科学基金重点项目资助。','近日，我实验室收到国家自然科学基金委员会通知，由张明教授主持申报的\"面向复杂场景的智能视觉理解关键技术研究\"项目获得国家自然科学基金重点项目资助，资助金额300万元，项目执行期为2025-2029年。\n\n该项目旨在解决复杂场景下的智能视觉理解难题，研究内容涵盖多模态信息融合、场景理解、目标检测与跟踪等关键技术。项目的成功获批不仅体现了我实验室在人工智能领域的研究实力，也为未来几年的科研工作提供了有力支撑。\n\n项目组将充分利用这一平台，加强与国内外知名研究机构的合作，力争在项目执行期内取得一系列原创性成果。','实验室办公室',NULL,'news','published',1,49,'2025-09-28 12:36:19','2025-09-28 12:36:19','2025-10-20 11:30:23'),(4,'欢迎新同学加入实验室大家庭','2025年秋季学期，实验室迎来了5名新的研究生同学，为团队注入了新的活力。','随着新学期的到来，我实验室迎来了5名优秀的研究生新同学，其中博士生2名，硕士生3名。他们分别来自不同的本科院校，都对人工智能研究充满热情。\n\n在迎新会上，张明教授向新同学介绍了实验室的研究方向和发展历程，并勉励大家要勤奋学习、勇于创新。老同学们也分享了自己的研究经验，帮助新同学尽快适应实验室的学习和研究环境。\n\n相信在大家的共同努力下，实验室这个大家庭会更加和谐温暖，在学术研究的道路上取得更多成果。','实验室办公室',NULL,'announcement','published',0,26,'2025-09-28 12:36:19','2025-09-28 12:36:19','2025-10-20 07:36:23'),(8,'final-test0','final-test1','final-test1','final-test1','/uploads/news/news-1760942885966-302776504.jpg','news','published',0,23,'2025-10-20 06:27:52','2025-10-20 06:27:51','2025-10-20 11:30:18');
/*!40000 ALTER TABLE `news` ENABLE KEYS */;
