INSERT INTO `projects` VALUES (1,'基于深度学习的图像识别系统','Deep Learning-based Image Recognition System','本项目旨在开发一套基于深度学习的高精度图像识别系统，可应用于医疗诊断、工业检测等领域。','national','国家自然科学基金委员会',500000.00,'张教授','张教授, 李副教授, 王研究员, 刘博士','2022-12-29','2025-12-28','ongoing','/uploads/projects/test-image.jpg',NULL,'2025-09-28 15:11:26','2025-09-28 15:38:19'),(2,'智能机器人导航算法研究','Intelligent Robot Navigation Algorithm Research','研究在复杂环境下机器人的自主导航算法，提高机器人在未知环境中的适应能力。','provincial','省科技厅',300000.00,'李副教授','李副教授, 陈博士, 杨硕士','2022-06-01','2024-06-30','ongoing',NULL,NULL,'2025-09-28 15:11:26','2025-09-28 15:11:26'),(3,'云计算环境下的数据安全技术','Data Security Technology in Cloud Computing Environment','针对云计算环境下的数据安全问题，研究新型加密算法和安全协议。','institutional','校科研基金',150000.00,'王研究员','王研究员, 周博士','2023-03-01','2024-03-01','ongoing',NULL,NULL,'2025-09-28 15:11:26','2025-09-28 15:11:26'),(4,'企业级软件系统开发','Enterprise Software System Development','与企业合作开发大型企业管理软件系统，提升企业信息化水平。','enterprise','ABC科技公司',800000.00,'刘博士','刘博士, 徐工程师, 孙硕士','2022-09-01','2023-12-31','completed',NULL,NULL,'2025-09-28 15:11:26','2025-09-28 15:11:26'),(5,'国际合作AI算法优化项目','International Cooperation AI Algorithm Optimization Project','与国外知名大学合作，共同研究人工智能算法的优化方法。','international','国际合作基金',400000.00,'陈博士','陈博士, 外籍专家, 本地团队','2023-07-01','2025-07-01','ongoing',NULL,NULL,'2025-09-28 15:11:26','2025-09-28 15:11:26'),(6,'1','111','111。 ','national','11',0.00,'111','11','2025-08-30','2025-09-08','completed','/uploads/projects/project-1759075100339-861181815.jpeg',NULL,'2025-09-28 15:48:21','2025-10-20 07:20:17'),(7,'final-test1',NULL,'final-test1','national',NULL,0.00,'final-test1',NULL,NULL,NULL,'ongoing','/uploads/projects/project-1760946638780-166626067.jpg',NULL,'2025-10-20 07:20:35','2025-10-20 07:50:40');
