INSERT INTO `publications` VALUES (1,'基于深度学习的图像识别算法研究','张教授, 李副教授, 王研究员',NULL,'IEEE Transactions on Pattern Analysis and Machine Intelligence','45','3','234-248',2023,'10.1109/TPAMI.2023.1234567','https://doi.org/10.1109/TPAMI.2023.1234567',NULL,'本文提出了一种基于深度学习的新型图像识别算法，在多个标准数据集上达到了最先进的性能。','深度学习, 图像识别, 卷积神经网络','journal',17.730,12,1,'2025-09-28 16:04:10','2025-09-28 16:04:10'),(2,'智能机器人路径规划优化方法','李副教授, 陈博士, 杨硕士',NULL,'Robotics and Autonomous Systems','168',NULL,'104-118',2023,'10.1016/j.robot.2023.104487','https://doi.org/10.1016/j.robot.2023.104487',NULL,'提出了一种基于强化学习的机器人路径规划方法，能够在动态环境中实现高效导航。','机器人, 路径规划, 强化学习','journal',3.690,8,1,'2025-09-28 16:04:10','2025-09-28 16:04:10'),(3,'云计算环境下的数据加密技术','王研究员, 周博士',NULL,'Journal of Information Security and Applications','71',NULL,'103-115',2022,'10.1016/j.jisa.2022.103377','https://doi.org/10.1016/j.jisa.2022.103377',NULL,'设计了一种适用于云计算环境的高效数据加密方案，保证了数据的安全性和访问效率。','云计算, 数据加密, 信息安全','journal',4.960,15,0,'2025-09-28 16:04:10','2025-09-28 16:04:10'),(4,'人工智能在医疗诊断中的应用研究','刘博士, 徐工程师',NULL,'Nature Machine Intelligence','5','4','312-325',2023,'10.1038/s42256-023-00654-8','https://doi.org/10.1038/s42256-023-00654-8',NULL,'综述了人工智能技术在医疗诊断领域的最新进展，讨论了挑战和未来发展方向。','人工智能, 医疗诊断, 机器学习','journal',25.890,23,1,'2025-09-28 16:04:10','2025-09-28 16:04:10'),(5,'边缘计算架构设计与优化','陈博士, 孙硕士',NULL,'计算机学报','46','5','901-915',2023,'10.11897/SP.J.1016.2023.00901',NULL,NULL,'针对边缘计算场景设计了一种新型架构，提高了计算效率和资源利用率。','边缘计算, 系统架构, 性能优化','journal',2.480,6,0,'2025-09-28 16:04:10','2025-09-28 16:04:10'),(6,'1','1',NULL,'1','1','1','1',2029,'1','www.baidu.com',NULL,'1','1','conference',1.000,10,1,'2025-09-29 10:23:25','2025-09-29 10:23:25'),(7,'1','1',NULL,'1','1','1','1',2029,'1','www.baidu.com',NULL,'1','1','journal',1.000,1,1,'2025-09-29 10:39:50','2025-09-29 10:39:50'),(8,'1','1',NULL,'1','1','1','1',2029,'1','www.baidu.com',NULL,'1','1','journal',1.000,1,1,'2025-09-29 10:39:51','2025-09-29 10:39:51'),(9,'1','1',NULL,'1','1','1','1',2029,'1','www.baidu.com',NULL,'1','1','journal',1.000,1,1,'2025-09-29 10:39:52','2025-09-29 10:39:52'),(10,'1','1',NULL,'1','1','1','1',2029,'1','www.baidu.com',NULL,'1','1','journal',1.000,1,1,'2025-09-29 10:39:52','2025-09-29 10:39:52'),(11,'1','1',NULL,'1','1','1','1',2029,'1','www.baidu.com',NULL,'1','1','journal',1.000,1,1,'2025-09-29 10:40:03','2025-09-29 10:40:03'),(12,'1','1',NULL,'1','1','1','1',2029,'1','www.baidu.com',NULL,'1','1','journal',1.000,1,1,'2025-09-29 10:40:10','2025-09-29 10:40:10'),(13,'1','1','[1]','1','1','1','1',2029,'1','www.baidu.com',NULL,'1','1','journal',1.000,1,0,'2025-09-29 10:40:11','2025-10-03 12:57:12'),(20,'Tensor-to-JPEG FibFormer: A privacy-constrained speech emotion recognition framework using transformers and Fibonacci position embedding','Changzeng Fu, Qi Zhang, Zelin Fu, Fengkui Qian, Zirui Qiu, Ning Lu, Wenbo Shi','[]','Expert Systems with Applications','1','1','1-10',2025,'11','https://www.zhangqi.online','/Users/zhangqi/Desktop/实验室建站/2框架测试/LabPage/backend/uploads/publications/publication-1759489885024-718020385.pdf','Current speech emotion recognition models rely on high-fidelity speech content and its features to infer emotions. However, high-fidelity speech data often contains comprehensive privacy information. Despite numerous encryption methods designed to secure privacy during transmission, data can still reveal privacy information, especially when restored before model input cloud server side. To mitigate this risk, this paper introduces a method that transcodes feature tensors into JPEG images, effectively converting speech features into irrecoverable image data. Additionally, considering the capabilities of existing generative models, which can reconstruct JPEGs into tensors given sufficient data, we have designed a Transformer-based model with Fibonacci position embedding (FibFormer). This model splits the complete JPEG data into multiple dispersed tokens and encodes each token’s position using the Fibonacci sequence. This approach ensures the necessary positional encoding for the Transformer while concealing the true location of each token, preventing data reconstruction. Experiments conducted on the IEMOCAP and MELD datasets demonstrate that the Tensor-to-JPEG FibFormer maintains efficiency and competitive performance in speech emotion recognition while ensuring privacy constraints in speech data.','1,1,1,1','journal',11.000,1,0,'2025-10-03 11:11:25','2025-10-03 13:14:33'),(21,'test1\r\n','Changzeng Fu, Qi Zhang, Zelin Fu, Fengkui Qian, Zirui Qiu, Ning Lu, Wenbo Shi','[]',NULL,NULL,NULL,NULL,2025,NULL,NULL,NULL,NULL,NULL,'journal',NULL,0,0,'2025-10-03 13:03:29','2025-10-03 13:14:39'),(22,'test2','Fu, C., Zhang, Q., ..., Qiu, Z., Lu, N., & Shi, W. (2025).','[1, 8]',NULL,NULL,NULL,NULL,2026,NULL,NULL,NULL,NULL,NULL,'journal',NULL,0,0,'2025-10-03 13:15:03','2025-10-03 13:31:00'),(23,'final-test1','1','[9]','1','1','1','1',2025,'1',NULL,NULL,'1','1','journal',1.000,1,1,'2025-10-20 07:51:39','2025-10-20 07:52:43'),(24,'final-test1','1','[9]','111',NULL,NULL,'1',2025,'1',NULL,NULL,'1','1','conference',1.000,1,0,'2025-10-20 11:20:17','2025-10-20 11:20:17');
