INSERT INTO `recruitment` VALUES (1,'招收硕士研究生','master',3,'1. 本科专业为计算机相关专业；2. 具有良好的数学基础和编程能力；3. 对科学研究有浓厚兴趣；4. 英语六级以上。','本实验室长期招收计算机科学与技术、软件工程相关专业硕士研究生，研究方向包括人工智能、机器学习、计算机视觉等前沿领域。提供充足的科研经费支持，优秀者可获得奖学金。','联系人：张教授\r\n邮箱：zhang@university.edu.cn\r\n电话：010-12345678','2025-12-31 00:00:00','open',1,'2025-09-28 16:09:10','2025-10-04 12:16:09'),(2,'招收博士研究生','phd',2,'1. 硕士学位，计算机相关专业；2. 有高质量论文发表经验优先；3. 熟练掌握Python、C++等编程语言；4. 具备独立科研能力。','面向全国招收计算机科学与技术专业博士研究生，重点研究深度学习、强化学习、自然语言处理等人工智能前沿技术。博士期间全额资助，优秀者可申请国家奖学金。','联系人：李教授\n邮箱：li@university.edu.cn\n电话：010-12345679','2025-10-31 00:00:00','open',1,'2025-09-28 16:09:10','2025-09-28 16:09:10'),(3,'招聘博士后研究员','postdoc',2,'1. 计算机科学、人工智能等相关专业博士学位；2. 在顶级会议/期刊发表高水平论文；3. 具有扎实的理论基础和实践经验；4. 年龄不超过35岁。','诚聘机器学习、计算机视觉方向博士后研究员，从事前沿科学研究工作。年薪20-35万元，提供科研启动经费，协助申请各类人才项目。','联系人：王研究员\n邮箱：wang@university.edu.cn\n电话：010-12345680','2025-11-30 00:00:00','open',1,'2025-09-28 16:09:10','2025-09-28 16:09:10'),(4,'访问学者招募','visiting',1,'1. 计算机相关专业博士学位；2. 在相关领域有一定研究基础；3. 访问期间不少于6个月；4. 具有良好的英语交流能力。','欢迎海内外学者来实验室进行学术访问，开展合作研究。提供良好的研究环境和学术氛围，协助申请各类访问学者基金。','联系人：陈博士\n邮箱：chen@university.edu.cn\n电话：010-12345682','2025-12-31 00:00:00','open',0,'2025-09-28 16:09:10','2025-09-28 16:09:10'),(5,'1','master',1,'1','1','1','2025-09-17 00:00:00','open',0,'2025-09-28 16:39:23','2025-09-28 16:39:23'),(6,'test1','postdoc',10,'1','test1','test1','2025-09-13 00:00:00','open',0,'2025-09-28 16:46:09','2025-09-28 16:46:09'),(7,'1','master',1,'1','1','1','2025-10-24 20:17:29','open',1,'2025-09-29 09:58:17','2025-10-04 12:17:33'),(8,'test1','master',1,'1','1','1','2025-10-22 00:00:00','closed',1,'2025-10-04 10:38:29','2025-10-04 12:55:21'),(9,'final-test1','master',1,'','final-test1   ','final-test1','2025-10-30 00:00:00','open',1,'2025-10-20 07:58:38','2025-10-20 07:59:36');
